prep:
  code: |-
    <code xmlns="http://xgridfit.sourceforge.net/Xgridfit2">
      <!-- Turn off hinting above 200 ppem -->
      <if test="pixels-per-em &gt; 200 or pixels-per-em &lt; 15">
        <disable-instructions/>
      </if>
      <!-- Dropout control -->
      <push>4 511</push>
      <command name="SCANCTRL"/>
      <command name="SCANTYPE"/>
    </code>
functions:
  delta:
    primitive: true
    stack-safe: true
    size:
      type: int
    distance:
      type: int
    pt:
      type: point
      subtype: target
    code: |-
      <code xmlns="http://xgridfit.sourceforge.net/Xgridfit2">
        <command name="SDB"/>
        <command name="DUP"/>
        <push>0</push>
        <command name="NEQ"/>
        <command name="IF"/>
        <command name="DUP"/>
        <push>0</push>
        <command name="LT"/>
        <command name="IF"/>
        <push>8</push>
        <command name="ADD"/>
        <command name="ELSE"/>
        <push>7</push>
        <command name="ADD"/>
        <command name="EIF"/>
        <command name="SWAP"/>
        <push>1</push>
        <command name="DELTAP1"/>
        <command name="ELSE"/>
        <command name="POP"/>
        <command name="POP"/>
        <command name="EIF"/>
        <push>8</push>
        <command name="SDB"/>
      </code>
